import React, {Component} from 'react';
import './css/Footer.css';

class Footer extends Component{
    render(){
        return(
            <footer>
                <div className="inner">
                        Contact Us: <br/>
                            Fixed : +94112222222  <br/>
                            Mobile : +94702323233<br/>
                        Email Address : gotrip@gmail.co<br/>
                        
                </div>
            </footer>
        )
    }
}
export default Footer;
